import{_ as l,p as i,q as e,Y as n}from"./framework-aa5c4115.js";const p={},t=n('<h3 id="绑定规则如下" tabindex="-1"><a class="header-anchor" href="#绑定规则如下" aria-hidden="true">#</a> 绑定规则如下：</h3><ul><li><p>绑定一：默认绑定；</p></li><li><p>绑定二：隐式绑定；</p></li><li><p>绑定三：显示绑定；</p></li><li><p>绑定四：new绑定；</p></li><li><p>默认绑定：独立函数调用就是所谓的默认绑定，独立的函数调用我们可以理解成函数没有被绑定到某个对象上进行调用</p></li><li><p>隐式绑定：通过某个对象进行调用的，也就是它的调用位置中，是通过某个对象发起的函数调用</p></li><li><p>显示绑定：通过call，apply，bind去绑定</p></li><li><p>new绑定： new的原理</p></li></ul><p><strong>优先级：</strong></p><ul><li>默认规则的优先级最低</li><li>显示绑定优先级高于隐式绑定</li><li>new绑定优先级高于隐式绑定</li><li>new绑定优先级高于bind</li><li>new绑定和call、apply是不允许同时使用的，所以不存在谁的优先级更高</li><li>箭头函数中的this需要向上找一层</li></ul>',4),a=[t];function c(r,s){return i(),e("div",null,a)}const o=l(p,[["render",c],["__file","index _04.html.vue"]]);export{o as default};
